#
# TABLE STRUCTURE FOR: actions
#

DROP TABLE IF EXISTS `actions`;

CREATE TABLE `actions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор акции',
  `product_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор товара',
  `head` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Заголовок акции',
  `body` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тело акции',
  `percentage` tinyint(3) unsigned DEFAULT NULL COMMENT 'Процент скидки',
  `product_id_gift` bigint(20) unsigned DEFAULT NULL COMMENT 'Идентификатор товара подарка',
  `price_reduction` int(10) unsigned DEFAULT NULL COMMENT 'Сумма скидки',
  `activated_at` datetime DEFAULT current_timestamp() COMMENT 'Время активации акции',
  `finished_at` datetime DEFAULT NULL COMMENT 'Время окончания акции',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Акции';



#
# TABLE STRUCTURE FOR: addresses
#

DROP TABLE IF EXISTS `addresses`;

CREATE TABLE `addresses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор адреса',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `city_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на город',
  `street` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Улица',
  `home` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Дом',
  `corpus` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Корпус',
  `flat` smallint(5) unsigned DEFAULT NULL COMMENT 'Кв/Офис',
  `metro` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Метро',
  `index` mediumint(8) unsigned DEFAULT NULL COMMENT 'Почтовый индекс',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Телефон',
  `other` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Прочее',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания адреса',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления адреса',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Адрес доставки';



#
# TABLE STRUCTURE FOR: brands
#

DROP TABLE IF EXISTS `brands`;

CREATE TABLE `brands` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор бренда',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT 'Название бренда',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания бренда',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления бренда',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `unique_name` (`name`(10))
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Бренды интернет-магазина Мегафон';



#
# TABLE STRUCTURE FOR: catalogs
#

DROP TABLE IF EXISTS `catalogs`;

CREATE TABLE `catalogs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор раздела',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT 'Название раздела',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания раздела',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления раздела',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `unique_name` (`name`(10))
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Разделы интернет-магазина Мегафон';



#
# TABLE STRUCTURE FOR: cities
#

DROP TABLE IF EXISTS `cities`;

CREATE TABLE `cities` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор адреса',
  `city_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Улица',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Города';



#
# TABLE STRUCTURE FOR: media
#

DROP TABLE IF EXISTS `media`;

CREATE TABLE `media` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор медиа',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя, который загрузил файл',
  `product_id` bigint(20) unsigned NOT NULL COMMENT 'Принадлежность к товару',
  `filename` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Путь к файлу',
  `size` int(11) NOT NULL COMMENT 'Размер файла',
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Метаданные файла',
  `media_type_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на тип контента',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Медиафайлы';



#
# TABLE STRUCTURE FOR: media_types
#

DROP TABLE IF EXISTS `media_types`;

CREATE TABLE `media_types` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор медиа типа',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название типа',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Типы медиафайлов';



#
# TABLE STRUCTURE FOR: news
#

DROP TABLE IF EXISTS `news`;

CREATE TABLE `news` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор раздела',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор раздела',
  `head` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Заголовок новости',
  `body` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тело новости',
  `is_public` tinyint(1) DEFAULT 1 COMMENT 'Является публичной новостью',
  `is_archived` tinyint(1) DEFAULT 0 COMMENT 'Является архивной новостью',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания новости',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления новости',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Новости';



#
# TABLE STRUCTURE FOR: order_products
#

DROP TABLE IF EXISTS `order_products`;

CREATE TABLE `order_products` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор пользователя',
  `order_id` bigint(20) unsigned COMMENT 'Ссылка на заказ',
  `product_id` bigint(20) unsigned COMMENT 'Ссылка на товар',
  `product_quantity` int(10) unsigned NOT NULL COMMENT 'Кол-во товара',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Заказы';



#
# TABLE STRUCTURE FOR: orders
#

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор пользователя',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания заказа',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления заказа',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Заказы';



#
# TABLE STRUCTURE FOR: products
#

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор товара',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT 'Название товара',
  `description` text CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT 'Описание',
  `price` decimal(11,2) DEFAULT NULL COMMENT 'Цена',
  `catalog_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на раздел',
  `brand_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на бренд',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания товара',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления товара',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Таблица товаров';



#
# TABLE STRUCTURE FOR: related_products
#

DROP TABLE IF EXISTS `related_products`;

CREATE TABLE `related_products` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор характеристики',
  `product_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор товара для характеристики',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания характеристики',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления характеристики',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Связанные товары';



#
# TABLE STRUCTURE FOR: requisites
#

DROP TABLE IF EXISTS `requisites`;

CREATE TABLE `requisites` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор реквизита',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `address_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на адрес',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Телефон',
  `main_state_registration_number` varchar(13) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ОГРН',
  `taxpayer_identification_number` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'ИНН',
  `reason_code_registration` varchar(9) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'КПП',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания реквизита',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления пользователя',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Адрес доставки';



#
# TABLE STRUCTURE FOR: reviews
#

DROP TABLE IF EXISTS `reviews`;

CREATE TABLE `reviews` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор отзыва',
  `user_id` int(10) unsigned COMMENT 'Идентификатор пользователя',
  `product_id` bigint(20) unsigned COMMENT 'Идентификатор товара',
  `body` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тело отзыва',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания отзыва',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Отзывы';



#
# TABLE STRUCTURE FOR: score
#

DROP TABLE IF EXISTS `score`;

CREATE TABLE `score` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор оценки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор пользователя',
  `product_id` bigint(20) unsigned NOT NULL COMMENT 'Идентификатор товара',
  `value` tinyint(3) unsigned DEFAULT 0 COMMENT 'Значение оценки',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания оценки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления оценки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Оценки';



#
# TABLE STRUCTURE FOR: specifications
#

DROP TABLE IF EXISTS `specifications`;

CREATE TABLE `specifications` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор характеристики',
  `product_id` bigint(20) unsigned COMMENT 'Идентификатор товара для характеристики',
  `short_description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Короткое описание',
  `description` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Описание',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания характеристики',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления характеристики',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Характеристики';



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор пользователя',
  `password` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Пароль',
  `full_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ФИО',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Телефон',
  `subscription` tinyint(4) DEFAULT 0 COMMENT 'Подписка',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания пользователя',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления пользователя',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Пользователи';



